import React from 'react';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';


export const Continents = ({ cont_reg, onClick }) => {
    console.log(cont_reg);
    return (
        <div>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand>Continents</Navbar.Brand>
                <Nav className="mr-auto">
                    {Object.entries(cont_reg).map(([cont, reg]) =>
                        <NavDropdown title={cont} id="{cont}-dropdown">
                            {reg.map(r =>
                                <NavDropdown.Item eventKey={r} onClick={(e) => onClick(cont, r)}>{r}</NavDropdown.Item>)}
                        </NavDropdown>)}
                </Nav>
            </Navbar>
        </div>
    )
}
